import React from 'react';
import { FaFacebook} from "react-icons/fa";
import { AiFillInstagram} from "react-icons/fa";
import {AiFillGithub} from "react-icons/fa";

const SlideBar = () => {
	return (
		<div>
			<FaFacebook color="purple"/>
			<AiFillGithub color="purple"/>
			<AiFillInstagram color="purple"/>
		</div>
	);
};

export default SlideBar;
